import React from "react";
import "./status.css";

const Status = (props)=>{
    const {status, id} = props;

    const Loading = ()=>{
        return(
            <div className="status-container">
                <p>Loading</p>
            </div>
        )
    };
    const Failure = ()=>{
        return(
            <div className="status-container">
                <p>Failure</p>
            </div>
        )
    }
    const Success = ()=>{
        return(
            <div className="status-container">
                <p>Success {id}</p>
            </div>
        )
    }
    
    if(status === "success"){
        return <Success />
    }else if(status === "Failure"){
        return <Failure />
    }else {
        return <Loading />
    }
};


export default Status;
